import styled from "styled-components"
import { ReactComponent as MagnifyingGlass } from '../../icons/magnifying-glass.svg';
const MainWrapper = styled.section`
margin: 0 auto;
height: 360px;
width: 536px;
display: flex;
flex-direction: column;
align-items: center;
`
const SearchType = styled.div`
width: 100%;
box-sizing: border-box;
display: flex;
justify-content: space-between;
padding-left: 50px;
padding-right: 50px;
margin: 65px auto 20px auto;
font-weight: 700;
font-size: 20px;
`
const VinBlock = styled.div`
display: flex;
align-items: center;
justify-content: center;
width: 163px;
height: 33px;
border-bottom: 2px solid #3AD0E6;
`
const LicenseBlock = styled.div`
display: flex;
align-items: center;
justify-content: center;
width: 163px;
height: 33px;
border-bottom: 2px solid #3AD0E6;
`
const Input = styled.input`
margin: 0 auto;
box-sizing: border-box;
width: 100%;
height: 60px;
border-radius: 40px;
padding-left:60px;
padding-right: 140px;
border: 1px solid #000000;
box-shadow: 0px 0px 0px 6px rgba(0, 0, 0, 0.04), inset 0px 4px 4px rgba(0, 0, 0, 0.2);
:focus{
    outline 2px solid #3AD0E6
}
    ::placeholder{
    font-family: 'Roboto';
    font-weight: 200;
    font-size: 20px;
    color: #3A3A3A;

}
`
const MagnifyingGlassIcon = styled(MagnifyingGlass)`
top: 18px;
left: 17px;
position: absolute;
width: 24px;
height: 24px;
`
const Button = styled.button`
top: 9px;
right: 17px;
position: absolute;
width: 124px;
height: 44px;
background-color: #3AD0E6;
border: 1px solid #000000;
font-weight: 700;
font-size: 18px;
border-radius: 40px;
margin-left: 10px;

`
const Search = () => {
    return (
        <MainWrapper>
            <SearchType>
                <VinBlock>VIN</VinBlock>
                <LicenseBlock>LICENSE PLATE</LicenseBlock>
            </SearchType>
            <form style={{ width: '100%', position: "relative" }}>
                <MagnifyingGlassIcon />
                <Button>Search</Button>
                <Input placeholder="Enter a VIN Number" />
            </form>
        </MainWrapper >
    )
}

export default Search;
